//import logo from './logo.svg';
import './App.css';
import Login from '././login/Login';
import { BrowserRouter,Routes,Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />}/>
      </Routes>
</BrowserRouter>
    </div>
  );
}

export default App;
